          "description": "This episode introduces a new set of characters - Chiaki Yoshino, a male author who releases shōjo manga under the female pseudonym Chiharu Yoshikawa; Yoshiyuki Hatori, his manager and childhood friend; and Yuu Yanase, his chief assistant, who is on rough but unclear terms with his manager. Hatori's increasing coldness toward Chiaki begins to take its toll on their friendship, and when pressed on personal matters, Hatori becomes distant. Chiaki later sees Hatori and Yuu in an alley having what he interprets as an argument between lovers. Growing distraught with confusion that begins to affect his ability to write, Chiaki slowly realizes his feelings for Hatori. However, Hatori later confesses his love for Chiaki, much to his surprise, along with admitting that he had changed Chiaki's management behind Chiaki's back, fearing that his confession would put their relationship on bad terms. This forces Chiaki to admit his own budding feelings."
