          "site": "Crunchyroll",
          "description": "The episode begins with Ritsu having another flashback dream, in which he sees Saga sleeping in the library and tries to find out what book he was reading, but runs away when he thinks Saga is about to wake up. Afterwards, Ritsu wakes up and goes to work. At Marukawa, Ritsu's assignment is to make his first proposal as a manga editor to publish the manga he's supervising as a book. It is initially rejected by Takano, so he stays late at night working on it. Later that night, Takano helps Ritsu with his proposal, even though Ritsu didn't want his help. After a while, Takano suddenly kisses him to break the tension, and consequently gets hit by Ritsu. Yokozawa then arrives and sends Takano to meet someone. When he's alone with Ritsu, Yokozawa proclaims Takano as his property, and doesn't believe Ritsu's words about not having any relation with Masamune other than that of boss-subordinate. At a bookstore the next day, Ritsu meets an old female friend from his previous job, and they go for drinks. She gets drunk, stumbles, and falls into Ritsu's arms. This is seen by Takano, who had just arrived with Ichinose Erika, a female writer, to discuss work (Ritsu misunderstands this and feels jealous). When he arrives home, Takano accuses him of not working hard enough. Takano makes another pass and admits to being in love with him, but Ritsu (who is still wary of admitting his love for Takano) runs away and leaves Takano alone in his apartment. The proposal meeting day arrives and Ritsu is quite nervous, but Takano tries to cheer him up on the way to the meeting. In this episode another Junjou Romantica character appears; Isaka Ryuichiro."
