          "site": "Crunchyroll",
          "description": "Onodera wakes up in the doorway, still holding on to a convenience store-bought dinner, and suddenly remembers a meeting that he was to sit in in the morning. On the subway, he complains about his lifestyle after joining the shōjo manga department. Onodera is surprised by the hostility shown in the proposal meeting and dreads future meetings. After the conference, Onodera meets Sumi Ryouichi (father of Sumi Keiichi from Junjo Romantica), whom he was in charge of before in the literature department at his father's company. Through Sumi sensei, Onodera also meets Hasegawa of the literature department, who later dropped in on Onodera during work and invited him out for a drink. Takano, who happened to hear the invitation, rejected it for Onodera. After commenting on Takano's strictness, Hasegawa reminds Onodera that he can always transfer to the literature department if he no longer wants to work on manga. Later, Onodera encounters Takano at the library and tries to run away. Takano saves him from falling down the stairs as Onodera trips on fallen leaves; as they embrace on the stairs, Takano tries to evoke past memories from the time when they were dating in high school, but Onodera escapes again. At the apartment, Onodera encounters Yokozawa, who apparently was coming out from Takano's room with Takano's cat, Sorata. Yokozawa confronts Onodera and claims Takano as his, and further throws Onodera into confusion by recounting how Onodera had only hurt Takano since they have known each other."
